import React from "react";

const Heading = (props) => {
    const Val=props.val;
    const click=props.Click;

    return (
        <>
            <div class="container-fluid">
                <div className="row bg-dark">
                    <div className="col-md-8">
                        <span className="design" className="text-light"> <i class="fas fa-utensils" ></i></span>
                        <h1 className="text-light">Food Recipe</h1>
                    </div>
                    <div className="col-md-4">
                        <div class="input-group mb-3 ">
                            <input type="text" class="form-control" placeholder="Search Your Recepe..." aria-label="First name" value={Val} onChange={click} />
                            <button onClick class="btn btn-outline-secondary btn-primary text-dark" type="button" id="button-addon2">Button</button>
                        </div>
                    </div>

                </div>
            </div>
        </>
    );
}

export default Heading;
